-- 사용자 데이터

-- 브랜드 데이터

-- 임시 테이블 생성 (형용사, 명사)
CREATE TEMPORARY TABLE temp_adjectives (id INT AUTO_INCREMENT PRIMARY KEY, adjective VARCHAR(100));
CREATE TEMPORARY TABLE temp_nouns (id INT AUTO_INCREMENT PRIMARY KEY, noun VARCHAR(100));

-- 형용사 데이터 삽입

-- 명사 데이터 삽입

-- 크로스 조인으로 100만개 상품 생성
SELECT 
  CONCAT(a.adjective, ' ', n.noun) as name,
  (a.id * 1000 + n.id * 100 + FLOOR(RAND() * 10000)) as price,
  GREATEST(1, FLOOR(RAND() * 100)) as stock,
  GREATEST(1, FLOOR(RAND() * 100)) as max_order_quantity,
  (FLOOR(RAND() * 94) + 1) as brand_id,
  CASE WHEN FLOOR(RAND() * 100) > 20 THEN 'ACTIVE' ELSE 'OUT_OF_STOCK' END as status,
  NOW() as created_at,
  NOW() as updated_at
FROM temp_adjectives a
CROSS JOIN temp_nouns n
LIMIT 1000000;

-- 임시 테이블 정리
DROP TEMPORARY TABLE IF EXISTS temp_adjectives;
DROP TEMPORARY TABLE IF EXISTS temp_nouns;
